DROP TABLE `oc_product_special`;
CREATE TABLE `oc_product_special` (  `product_special_id` int(11) NOT NULL AUTO_INCREMENT,  `product_id` int(11) NOT NULL,  `customer_group_id` int(11) NOT NULL,  `priority` int(5) NOT NULL DEFAULT '1',  `price` decimal(15,4) NOT NULL DEFAULT '0.0000',  `date_start` date NOT NULL DEFAULT '0000-00-00',  `date_end` date NOT NULL DEFAULT '0000-00-00',  PRIMARY KEY (`product_special_id`),  KEY `product_id` (`product_id`)) ENGINE=MyISAM AUTO_INCREMENT=445 DEFAULT CHARSET=utf8;
DROP TABLE `oc_product_to_category`;
CREATE TABLE `oc_product_to_category` (  `product_id` int(11) NOT NULL,  `category_id` int(11) NOT NULL,  PRIMARY KEY (`product_id`,`category_id`),  KEY `category_id` (`category_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE `oc_product_to_download`;
CREATE TABLE `oc_product_to_download` (  `product_id` int(11) NOT NULL,  `download_id` int(11) NOT NULL,  PRIMARY KEY (`product_id`,`download_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8;
