DROP TABLE `oc_recurring`;
CREATE TABLE `oc_recurring` (  `recurring_id` int(11) NOT NULL AUTO_INCREMENT,  `price` decimal(10,4) NOT NULL,  `frequency` enum('day','week','semi_month','month','year') NOT NULL,  `duration` int(10) unsigned NOT NULL,  `cycle` int(10) unsigned NOT NULL,  `trial_status` tinyint(4) NOT NULL,  `trial_price` decimal(10,4) NOT NULL,  `trial_frequency` enum('day','week','semi_month','month','year') NOT NULL,  `trial_duration` int(10) unsigned NOT NULL,  `trial_cycle` int(10) unsigned NOT NULL,  `status` tinyint(4) NOT NULL,  `sort_order` int(11) NOT NULL,  PRIMARY KEY (`recurring_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8;
