DROP TABLE `oc_return_status`;
CREATE TABLE `oc_return_status` (  `return_status_id` int(11) NOT NULL AUTO_INCREMENT,  `language_id` int(11) NOT NULL DEFAULT '0',  `name` varchar(32) NOT NULL,  PRIMARY KEY (`return_status_id`,`language_id`)) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;
